import { useState } from "react";

const UserForm = ({
  checkMaster,
  authorizedUser,
  setFirstName,
  setLastName,
  setRole,
  setLanguage,
  setEmail,
  setOldPassword,
  setPassword,
  setConfirmPassword,
  loading,
  firstName,
  lastName,
  role,
  language,
  email,
  page,
}) => {
  const [oldPasswordType, setOldPasswordType] = useState(false);
  const [passwordType, setPasswordType] = useState(false);
  const [password2Type, setPassword2Type] = useState(false);

  return (
    <>
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <label className="text-lg my-2 select-none self-start font-medium">First Name</label>
        <input className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
          type="text"
          placeholder="Enter your first name"
          value={firstName || undefined}
          onChange={(e) => setFirstName(e.target.value)}
        />
      </div>
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <label className="text-lg my-2 select-none self-start font-medium">Last Name</label>
        <input className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
          type="text"
          placeholder="Enter your last name"
          value={lastName || undefined}
          onChange={(e) => setLastName(e.target.value)}
        />
      </div>
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <label className="text-lg my-2 select-none self-start font-medium">Role</label>
        <select className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
          onChange={(e) => setRole(e.target.value)}
          value={role || undefined}
        >
          <option label="-- Select an option --"></option>
          {!checkMaster && <option value="master">Master</option>}
          {authorizedUser && <option value="admin">Admin</option>}
          <option value="tailor">Tailor</option>
        </select>
      </div>
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <label className="text-lg my-2 select-none self-start font-medium">Language</label>
        <select className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
          onChange={(e) => setLanguage(e.target.value)}
          value={language || undefined}
        >
          <option value="en" label="English"></option>
          <option value="hi" label="Hindi"></option>
          <option value="ur" label="Urdu"></option>
          <option value="ar" label="Arabic"></option>
        </select>
      </div>
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <label className="text-lg my-2 select-none self-start font-medium">Email</label>
        <input className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
          type="email"
          placeholder="Enter your email address"
          value={email || undefined}
          onChange={(e) => setEmail(e.target.value)}
        />
      </div>
      {page === "edit" && (
        <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
          <label className="text-lg my-2 select-none self-start font-medium">Old Password</label>
          <input className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
            type={oldPasswordType ? "text" : "password"}
            placeholder="Enter your old password"
            onChange={(e) => setOldPassword(e.target.value)}
          />
          <button
            type="button"
            className="absolute w-[12%] right-0 top-[60%] translate-y-[-50%] cursor-pointer capitalize hover:text-khamco-primary my-2"
            onClick={() => setOldPasswordType(!oldPasswordType)}
          >
            {oldPasswordType ? "Hide" : "Show"}
          </button>
        </div>
      )}
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <label className="text-lg my-2 select-none self-start font-medium">New Password</label>
        <input className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
          type={passwordType ? "text" : "password"}
          placeholder="Enter your desired password"
          onChange={(e) => setPassword(e.target.value)}
        />
        <button
          type="button"
          className="absolute w-[12%] right-0 top-[60%] translate-y-[-50%] cursor-pointer capitalize hover:text-khamco-primary my-2"
          onClick={() => setPasswordType(!passwordType)}
        >
          {passwordType ? "Hide" : "Show"}
        </button>
      </div>
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <label className="text-lg my-2 select-none self-start font-medium">Confirm Password</label>
        <input className="text-lg my-2 p-2 border border-gray-800 rounded-md outline-none font-sans focus:border-[blue]"
          type={password2Type ? "text" : "password"}
          placeholder="Confirm your password"
          onChange={(e) => setConfirmPassword(e.target.value)}
        />
        <button
          type="button"
          className="absolute w-[12%] right-0 top-[60%] translate-y-[-50%] cursor-pointer capitalize hover:text-khamco-primary my-2"
          onClick={() => setPassword2Type(!password2Type)}
        >
          {password2Type ? "Hide" : "Show"}
        </button>
      </div>
      <div className="w-full md:w-1/2 flex flex-col mx-auto my-4 relative">
        <button type="submit" className="bg-[blue] w-1/2 mx-auto p-4 text-white rounded-full border-none outline-none hover:bg-blue-900">
          {loading ? <i className="fas fa-spinner animate-spin"></i> : "Submit"}
        </button>
      </div>
    </>
  );
};

export default UserForm;
